import React, { useState } from "react";
import { Link } from "react-router-dom";
import "./Navbar.css";
import logo from "../assets/logo.png";

const Navbar = () => {
  const [active, setActive] = useState(null);

  const openMenu = (menu) => setActive(menu);
  const closeMenu = () => setActive(null);

  return (
    <header className="navbar-wrapper">

      {/* ===== TOP BAR ===== */}
      <div className="topbar">
        <div className="logo-section">
          <img src={logo} alt="RGM Logo" className="logo-img" />
          <h2 className="logo-text">RGM Line Haul Inc.</h2>
        </div>

        <div className="right-links">
          <Link to="/" onClick={closeMenu}>Home</Link>
          <Link to="/careers" onClick={closeMenu}>Careers</Link>
          <Link to="/gallery" onClick={closeMenu}>Gallery</Link>
          <Link to="/contact" onClick={closeMenu}>Contact</Link>
          <Link to="/join/apply" className="apply-btn" onClick={closeMenu}>
            Apply Now
          </Link>
        </div>
      </div>

      {/* ===== MAIN NAV ===== */}
      <nav className="main-nav">
        <ul className="nav-menu">

          {/* JOIN RGM */}
          <li
            onMouseEnter={() => openMenu("join")}
            onMouseLeave={closeMenu}
          >
            <span className="menu-title">Join the RGM Family</span>
            {active === "join" && (
              <div className="dropdown">
                <Link to="/join/apply">Apply Today</Link>
                <Link to="/join/inexperienced">Inexperienced Class A Drivers</Link>
                <Link to="/join/experienced">Experienced Class A Drivers</Link>
                <Link to="/join/openings">Current Openings</Link>
                <Link to="/join/pay">Pay</Link>
                <Link to="/join/equipment">Equipment</Link>
                <Link to="/join/benefits">Benefits</Link>
                <Link to="/join/cdl-schools">CDL Schools</Link>
              </div>
            )}
          </li>

          {/* SOLUTIONS */}
          <li
            onMouseEnter={() => openMenu("solutions")}
            onMouseLeave={closeMenu}
          >
            <span className="menu-title">Transportation Solutions</span>
            {active === "solutions" && (
              <div className="dropdown">
                <Link to="/solutions">Solutions</Link>
                <Link to="/solutions/why-rgm">Why RGM Family</Link>
              </div>
            )}
          </li>

          {/* LOGISTICS */}
          <li
            onMouseEnter={() => openMenu("logistics")}
            onMouseLeave={closeMenu}
          >
            <span className="menu-title">RGM Logistics</span>
            {active === "logistics" && (
              <div className="dropdown">
                <Link to="/logistics/3pl">3PL</Link>
                <Link to="/logistics/ltl">LTL</Link>
                <Link to="/logistics/special-ops">Special OPS</Link>
                <Link to="/logistics/intermodal">Intermodal</Link>
                <Link to="/logistics/bulk">Bulk</Link>
                <Link to="/logistics/truckload">Truckload</Link>
                <Link to="/logistics/why-rgm">Why RGM Family</Link>
                <Link to="/logistics/who-we-are">Who We Are</Link>
              </div>
            )}
          </li>

          {/* COMPANY */}
          <li
            onMouseEnter={() => openMenu("company")}
            onMouseLeave={closeMenu}
          >
            <span className="menu-title">Our Company</span>
            {active === "company" && (
              <div className="dropdown">
                <Link to="/company/employee-ownership">Employee Ownership</Link>
                <Link to="/company/benefits">Benefits</Link>
                <Link to="/company/responsibility">Corporate Responsibility</Link>
                <Link to="/company/founder">About RGM Founder</Link>
              </div>
            )}
          </li>

        </ul>
      </nav>

    </header>
  );
};

export default Navbar;
